import React from 'react';

function Predict() {
  return (
    <div style={{
      minHeight: '100vh',
      padding: '2rem',
      textAlign: 'center',
      backgroundColor: '#fef2f2'
    }}>
      <h2 style={{ fontSize: '2.5rem', marginBottom: '1rem', color: '#7f1d1d' }}>
        Earthquake Death Predictor
      </h2>
      <iframe
        src="http://localhost:8501"
        title="Streamlit Earthquake Predictor"
        width="100%"
        height="800px"
        style={{
          border: '1px solid #b91c1c',
          borderRadius: '12px',
          boxShadow: '0 0 10px rgba(0,0,0,0.1)',
          backgroundColor: '#fef2f2'
        }}
      ></iframe>
    </div>
  );
}

export default Predict;
